After an answer i tried this</p>
<pre class="lang-js prettyprint-override"><code>cursor.toArray((error, result) =&gt; {
        if(error) {
            return res.status(500).send(error);
        }
        cursor.forEach(doc =&gt; {
            res.send(doc)
          })

    });

</code></pre>
